import React, {Component} from 'react';
import {Button} from "react-bootstrap";

const HeadersProps = [
    {id: 1, title: "Header1"},
    {id: 2, title: "Header2"}
];

class TestComponent extends Component {
    constructor(props) {
        super(props);

        this.state = {
            headers: this.props.headers,
            footers: this.props.footers,
        }

    }


    componentDidMount() {

        console.log(this.state.footers)

    }


    handleClick = () => {
        this.props.handleClick()
    }

    render() {
        return (
            <div>
                <h2 className="text-center">Some Flights</h2>
                <div className="row" style={{marginLeft: "10px", marginRight: "10px"}}>
                    <table className="table table-striped table-bordered">
                        <thead>
                        <tr>
                            {
                                this.state.headers.map(currentHeader =>
                                    <th key={currentHeader.id}>{currentHeader.title}</th>
                                )
                            }
                        </tr>
                        </thead>
                    </table>
                </div>
                <button className="btn btn-success" style={{marginTop: "10px"}}
                        onClick={this.handleClick}>Save
                </button>

            </div>
        );
    }
}

export default TestComponent;
